import css from "styled-jsx/css";

export const style = css`
main{
   width:100%;
  .container{
      display: flex;
      flex-direction: column;
      align-items: center;
      width: 80%;
  }
  .card{
    border: solid gray 1px;
    margin-bottom: 2rem;
    padding: 2rem;
  }
}
`
